import React, { useState } from 'react';

function EmployeeForm() {
  const [formData, setFormData] = useState({
    empName: '',
    empid: '',
    AnnualPaidLeave: '',
    Time_IN: '',
    Time_Out: '',
    Allowed_Late: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Here you can handle form submission, e.g., send data to backend or perform validation
    console.log(formData);
  };

  return (
    <div>
      <h2>Employee Form</h2>
      <form onSubmit={handleSubmit}>
        <label>
          Employee Name:
          <input
            type="text"
            name="empName"
            value={formData.empName}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Employee ID:
          <input
            type="text"
            name="empid"
            value={formData.empid}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Annual Paid Leave:
          <input
            type="number"
            name="AnnualPaidLeave"
            value={formData.AnnualPaidLeave}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Time In:
          <input
            type="time"
            name="Time_IN"
            value={formData.Time_IN}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Time Out:
          <input
            type="time"
            name="Time_Out"
            value={formData.Time_Out}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Allowed Late:
          <input
            type="number"
            name="Allowed_Late"
            value={formData.Allowed_Late}
            onChange={handleChange}
          />
        </label>
        <br />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default EmployeeForm;
